import React, {Component} from 'react';
import {connect} from 'react-redux';
import * as userActions from '../../redux/actions/userActions'
import * as publicationsActions from '../../redux/actions/userActions'

const {getAll:usersGetAll}=userActions;
const {getUser:publicationsGetUser}=publicationsActions

class Publications extends Component{

    componentDidMount(){
        //sino existen los usuarios traerlos
        if(!this.props.usersReducers.users.length){
            this.props.publicationsGetAll();
        }   
        this.props.publicationsGetUser();
    }
    render(){
        console.log(this.props)
        return(
            <div>
                <h1>
                    Publicaciones de
                </h1>
               {this.props.match.params.key}
            </div>
        )
    }
}
const mapStateToProps= ({usersReducers, publicationsReducers}) => {
    return {
        usersReducers,
        publicationsReducers
    };
};

const mapDispatchToProps=({
    usersGetAll,
    publicationsGetUser
})
export default connect(mapStateToProps,mapDispatchToProps)(Publications);
